function GetMaskNumber(Text,DefaultValue=null) {
    if (!Text) {
        if (DefaultValue != null) {
            return DefaultValue;
        } else {
             Text = 0;
        }
    }
    try {
        var Value = RoundNumber(Text.replace(/[^\d.-]/g, ""));
        if (Value == 0) {
            if (DefaultValue != null) {
                return DefaultValue;
            } else {
                return Value;
            }
        } else {
            return Value;
        }
    } catch (err) {
        return parseFloat(Text);
    }
}
