function GetCheckBookTypeName(CType) {
    var type;
    if (CType == 'TCCR') {
        type = 'Cash Reciept';
    } else if (CType == 'TCCW') {
        type = 'Cash Withdraw';
    } else if (CType == 'TCBR') {
        type = 'Bank Check-Recieved'
    } else if (CType == 'TCBC') {
        type = 'Bank Check-out';
    } else if (CType == 'TCBT') {
        type = 'Checkbook Transfer';
    } else if (CType == 'TBR') {
        type = 'Bank Reconcile';
    } else if (CType == 'TCT') {
        type = 'Transfer Check To Bank';
    } else if (CType == 'TCVT' || CType == 'TCVC' || CType == 'TBVC') {
        type = 'Void';
    }
    return type;
}